import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Link from 'next/link'
import nookies from 'nookies'

export default class extends Component {
  constructor (props) {
    super(props);
    this.state = {
        ...this.props,
    };
  }

  componentDidMount() {
      console.log(this.state.userAgent)
      this.getFingerprint()
  }

  getFingerprint() {
    const Fingerprint2 = require('fingerprintjs2');
    const options = {excludes: {userAgent: true}}

    const cookies = nookies.get()
    console.log(cookies['fp'])

    Fingerprint2.get(options, (components) => {
        var values = components.map(function (component) { return component.value })
        var murmur = Fingerprint2.x64hash128(values.join(''), 31)
        nookies.set({}, 'fp', murmur, {
          maxAge: 30 * 24 * 60 * 60,
          path: '/',
        })
    });

    const cookies_after = nookies.get()
    console.log({ cookies_after })
  }

  render() {
      return(
        <div>
        <h2>Title</h2>
        <p>Something descriptive...</p>
        <Link href={{ pathname: 'question', query: { q: 1 }}} as="/question/1">
            <button>Start</button>
        </Link>
        </div>
      );
  }
}
